function AccountSetupViewModel(){var n=this;n.UserName=ko.observable();n.BusinessName=ko.observable();n.FullName=ko.observable();n.Email=ko.observable();n.Address=ko.observable();n.City=ko.observable();n.State=ko.observable();n.Zip=ko.observable();n.CurrentPassword=ko.observable();n.NewPassword=ko.observable();n.ConfirmPassword=ko.observable();n.VirtualNo=ko.observable();n.MobileNo=ko.observable();n.PhoneNo=ko.observable();n.ConcertId=ko.computed(function(){return $.cookie("concertid")});n.Load=function(){ShowLoader();$.ajax({type:"GET",url:webserviceURL+"concert/"+n.ConcertId(),contentType:"application/json; charset=utf-8",success:function(t){n.UserName(t.data.UserName);n.BusinessName(t.data.BusinessName);n.FullName(t.data.FullName);n.Email(t.data.Email);n.Address(t.data.Address);n.City(t.data.City);n.State(t.data.State);n.Zip(t.data.Zip);n.VirtualNo(t.data.VirtualNo);n.MobileNo(t.data.MobileNo);n.PhoneNo(t.data.PhoneNo);HideLoader()},error:function(n,t,i){HideLoader();ShowErrorMessage(n,t,i)}})};n.UpdateProfile=function(){ShowLoader();$.ajax({type:"PUT",url:webserviceURL+`concerts/${n.ConcertId()}/account`,data:{BusinessName:n.BusinessName(),FullName:n.FullName(),Email:n.Email(),Address:n.Address(),City:n.City(),State:n.State(),Zip:n.Zip(),CurrentPassword:n.CurrentPassword(),NewPassword:n.NewPassword(),ConfirmPassword:n.ConfirmPassword(),PhoneNo:n.PhoneNo(),MobileNo:n.MobileNo(),VirtualNo:n.VirtualNo()},success:function(){$.notify("Business account updated successfully.","success");HideLoader()},error:function(n,t,i){HideLoader();ShowErrorMessage(n,t,i)}})};n.Load()}$("body").addClass("accountset_body accont_coms concert__event concert_setup_body");var accountSetupViewModel=new AccountSetupViewModel;ko.applyBindings(accountSetupViewModel);